export function getList() {
    return fetch('https://reqres.in/api/users')
      .then(data => data.json())
  }
  
  export  async  function setItem(item) {
   return fetch('http://localhost:3333/list', {
     method: 'Get',
     headers: {
       'Content-Type': 'application/json'
     },
     body: JSON.stringify({ item })
   })
     .then(data => data.json())
  }
